fn main() {
    let input_str = "
\
                     
\
                     
\
                     
\
                     ";

    let mut code = Vec::<usize>::new();

    let mut zeile = 1; //Start bei 5 (Zeile 1, Spalte 1)
    let mut spalte = 1;

    for line in input_str.lines() {
        for c in line.split("") {
            match c {
                "U" => {
                    if zeile > 0 {
                        zeile -= 1;
                    }
                }
                "D" => {
                    if zeile < 2 {
                        zeile += 1;
                    }
                }
                "L" => {
                    if spalte > 0 {
                        spalte -= 1;
                    }
                }
                "R" => {
                    if spalte < 2 {
                        spalte += 1;
                    }
                }
                _ => (),
            }
        }
        code.push(zeile * 3 + spalte + 1);
    }
    println!("{:?}", code);
}
